%[text] ### IF ELSE Statement
x = 19
if isprime(x) % tests whether a number is prime 
    str = 'a prime number';
elseif ~mod(sqrt(x),1) % tests for a perfect square 
    str = 'a perfect square'
elseif ~mod(log2(x),1) % tests for a power of 2 
    str = 'a power of 2'
else
    str =  'none of the above';
end

fprintf('%d is %s\n', x, str) % fprintf outputs directly to the command window
