%[text] 
%[text] ## Which is the complement? Which has the LUT inverted?
%[text] ![](text:image:60fc)
%[text] Which Image (Image 1 vs Image 2) is the complement and which image has its look-up table inverted?
%%
%[text] ## Opening Images
%[text] The dot blot image can also be found in the Unit 1 data folder
%[text] - Change the current folder to the data folder
%[text] - Read in the image as `p.img` using the function `imread`
%[text] - We use the structure `p` to organize all of the image processing steps \
close all
clearvars
mmSetUnitDataFolder(1)
p.img = imread("Dot_Blot.png");
figure
imshow(p.img)
%[text] - How do we capture the dots? \
%%
%[text] ### Preprocessing steps: Complement
%[text] Remember, we want bright dots
%[text] - Create a complement of the image and assign to p.complement \
p.complement = imcomplement(p.img);
%%
%[text] Programmatically accessing fields in a structure
%[text] - type p.(
%[text] - display the complement image using `imshow` \

%%
%[text] ### Filtering the image for Image Contrast enhancement
%[text] Filtering steps often involve the median filter followed by a gaussian filter. Here we add an `adapthist` filter to help separate the dots from the background.
%[text] As you perform these steps, follow the money. Each outcome from the previous step should plug into the function of the next step.
p.median = medfilt2(p.complement);
p.gauss = imgaussfilt(p.median,2);
p.adapt = adapthisteq(p.gauss);
%[text] - we could just overwrite everything, but it is nice to have the intermediate steps captured so we have a visual record of our enhancement steps \
%%
%[text] #### Display the Preprocessing steps
tiledlayout(2,3) % force a 2X3 layout
mmShowStruct(p)
%[text] - How would you make the tile spacing tight?
%[text] - padding tight? \
%%
%[text] ### Segment 
%[text] Once you have pre-processed the images, then you are ready to segment. Here we just use `imbinarize`. 
p.binarize = imbinarize(p.adapt,'adaptive'); % notice the 'adaptive' addon here
figure
imshow(p.binarize)
%[text] - Usually the binarization process results in noise \
%%
%[text] ### Morphological Operations for Cleanup
%[text] Many of these functions are specific for masks
p.border = imclearborder(p.binarize); % removes noise that touches the edges. 
p.clean = bwareaopen(p.border,30); % clean up small noise
figure
imshowpair(p.complement,p.clean) % overlay complement image and final mask
%%
%[text] ### Logical Operations
%[text] Mask rows or columns
% mask top rows
topMask = false(size(p.clean)); % create false mask same size as p.clean
topMask(1:141,:) = true; % set top half to true

% mask left side columns
sideMask = false(size(p.clean));  % create false mask same size as p.clean
sideMask(:,1:225) = true; % set right half to true

% display results
figure
tiledlayout("horizontal")
nexttile
imshowpair(p.clean,topMask)
title("Top Mask")

nexttile
imshowpair(p.clean,sideMask)
title("Side Mask")
%%
%[text] #### Logical operations
%[text] - only top dots
%[text] - only bottom dots
%[text] - only side dots
%[text] - only right side dots \

%%
%[text] - What about XOR? \
imshow(xor(topMask,sideMask))
%%
%[text] ### Region Properties
%[text] The function region properties returns the properties. The 'basic' setting returns Area, Centroid, and Bounding Box.
mask = p.clean;
rp = regionprops(mask,'basic') 
%[text] - Is this a table?
%[text] - What is this? \
%%
%[text] Warning. Don't forget to include 'table' as the first input. Otherwise you'll get a structure as shown above. And things won't work as expected
rp = regionprops('table',mask,'basic') % returns a table
%[text] - each row represents one dot in the dot blot
%[text] - since we didn't include the image, we don't get the mean intensity (we will do that in a bit \
%%
%[text] ### Labeling Images
%[text] We use the function `text` to add labels to an image. This function requires an x and a y coordinate. We can add anything to an image, like your name
figure
imshow(p.img)
text(25,25,'Ernesto',Color='cyan')
%[text] - Try it now: Replace my name with yours
%[text] - Change the first two inputs `(25,25)` to another coordinate (e.g `12,12`) so that its not overlapping on the dot \
%%
%[text] #### Labeling Dots
%[text] If we want to directly label the dots, we can use the data from the `rp` table. For example, here are the X,Y coordinates of the first dot
x = rp.Centroid(1,1)
y = rp.Centroid(1,2)
%%
%[text] And here we add an x to the image on the first dot.
text(x,y,'x','Color','m','FontSize',18,'HorizontalAlignment','center','VerticalAlignment','middle')
%%
%[text] How would you add an plus sign to the second dot?

%[text] Or an asterisk to the last dot, In magenta

%%
%[text] The function `rectangle` adds a rectangle to the image using the coordinates from the bounding box column in `rp`.
%[text] Here we add a rectangle to the 5th box. 
rectangle('Position', rp.BoundingBox(5,:), 'EdgeColor', 'red');
%[text] - Add a rectangle to the 10th box
%[text] - try adjusting the line width to 2 \
%%
%[text] We can use the power of the FOR LOOP to label all the dots. Here we number the dots based on their order in the `rp` table.
figure % new figure
imshow(p.img)
for n=1:height(rp)
    x = rp.Centroid(n,1);
    y = rp.Centroid(n,2);
    text(x,y,num2str(n),Color='y') % num2str converts a number to a string
end
%[text] - How do we center the numbers?
%[text] - Can we change the size of the numbers?
%[text] - Right-click on `text` to get help \
%%
%[text] Sort ***rp*** by area size and then re-run the FOR LOOP above
rp = sortrows(rp,"Area");
%[text] - what is the order of the numbers different? \
%%
%[text] We can selectively label dots using an IF ELSE statement inside the the FOR LOOP. 
%[text] Here, we add rectangles to dots with area less than the 25th percentile
for n = 1:height(rp)
    if rp.Area(n) < prctile(rp.Area, 25)
        rectangle('Position', rp.BoundingBox(n,:), 'EdgeColor', 'red');
    end
end
%%
%[text] ### Get Intensity Properties of the Image
%[text] To get the intensity values, you need to add the image to the function call. Here we add the complement as the third input
rp = regionprops('table',mask,p.complement,{'Area','Centroid','MeanIntensity','BoundingBox'}) % add img and 'MeanIntensity'
%[text] - now we have a column called 'MeanIntensity' that contains the average intensity inside each dot \
%%
%[text] #### Histogram
%[text] Plot a histogram of the MeanIntensity

%[text] - there is a wide range of values \
%%
%[text] #### Group Stats
%[text] We can perform group stats
stats = groupsummary(rp,[],"mean",["Area" "MeanIntensity"])
%[text] - Notice that the second input is empty brackets — this just means apply the stats to all the rows
%[text] - how do you add std deviation to the calculation? median? \
